import React from "react";
import "../App.css";

const Adminpanel = () => {
  return (
    <>
      <h1 style={{ textAlign: "center", marginTop: "2rem" }}>STATICS</h1>
      <div className="adminpanel">
        <div className="statics">
          <h2>Admin Panel</h2>
          <br></br>
          <h2>15</h2>
        </div>
        <div className="statics">
          <h2>Instructor Panel</h2>
          <br></br>
          <h2>15</h2>
        </div>
      </div>
    </>
  );
};

export default Adminpanel;
